import '../css/Profile.css';
import '../css/style.css';
import '../css/Project.css';

import { Links } from './ProjectData';

export default function Header({type, title, src, link}) {

// how to pull from array to fill info 
// do I need to make a whole new header just to fix image

    return (
          
    <div className = "header-box">
    <div className = "header">

      <img className = "header-image" src = {src}/>

      <div className = "header-info">
          <div className = "header-type">{type}</div>
          <div className = "header-title">{title}</div>
          <div className = "header-desc" href = {link}>Use Prototype In Figma</div>
      </div>

    </div>

  </div>
    );
}
